        <div class=""row about-desc"" data-aos=""fade-up"">
            <div class=""col-full"">
                <p>
                    El Instituto Nacional de Electrificación –INDE- es una entidad estatal, autónoma y descentralizada, la cual goza de autonomía funcional, patrimonio propio, personalidad jurídica y plena capacidad para adquirir derechos y contraer obligaciones en materia de su competencia.
