    <section id='services' class=""s-services"">

        <div class=""row section-header has-bottom-sep"" data-aos=""fade-up"">
            <div class=""col-full"">
                <h3 class=""subhead"">Historia</h3>
                <h1 class=""display-2"">¿Quiénes somos?</h1>
            </div>
        </div> <!-- end section-header -->

        <div class=""row services-list block-1-2 block-tab-full"">

            <div class=""col-block service-item"" data-aos=""fade-up"">
                <div class=""service-icon"">
                    <i class=""icon-paint-brus");
                WriteLiteral(@"h""></i>
                </div>
                <div class=""service-text"">
                    <h3 class=""h2"">1959</h3>
                    <p ALIGN=""justify"">
                        El Congreso de la República, por medio del Decreto 1287 de fecha 27 de mayo de 1959,
                        aprueba la Ley Orgánica del Instituto Nacional de Electrificación –INDE–.
                    </p>
                </div>
            </div>

            <div class=""col-block service-item"" data-aos=""fade-up"">
                <div class=""service-icon"">
                    <i class=""icon-group""></i>
                </div>
                <div class=""service-text"">
                    <h3 class=""h2"">1965</h3>
                    <p ALIGN=""justify"">
                        Debido al clamor de otras comunidades por tener el servicio eléctrico, era necesario elevar la capacidad de generación,
                        por lo que en 1965, el INDE introduce la generación térmica, con el funcionamiento de la plant");
                WriteLiteral(@"a San Felipe,
                        que se ubicaba en San Felipe Retalhuleu, cuya capacidad era de 1 megavatio.
                    </p>
                </div>
            </div>

            <div class=""col-block service-item"" data-aos=""fade-up"">
                <div class=""service-icon"">
                    <i class=""icon-megaphone""></i>
                </div>
                <div class=""service-text"">
                    <h3 class=""h2"">1968</h3>
                    <p ALIGN=""justify"">
                        Con el objetivo de ser el ente encargado de llevar la electricidad a todos los rincones del país, en 1968 se construye la hidroeléctrica del Porvenir,
                        San Pablo, San Marcos, con capacidad de 2.0 megavatios.La segunda planta térmica se construyó en Escuintla y se le bautizó como Parque Térmico,
                        que hoy cuenta con una capacidad de 160 megavatios.
                    </p>
                </div>
            </div>

            <div class");
                WriteLiteral(@"=""col-block service-item"" data-aos=""fade-up"">
                <div class=""service-icon"">
                    <i class=""icon-earth""></i>
                </div>
                <div class=""service-text"">
                    <h3 class=""h2"">1982</h3>
                    <p ALIGN=""justify"">
                        Con paso acelerado para cumplir con la misión de llevar energía eléctrica a más poblaciones,
                        en 1982 se construye la hidroeléctrica Aguacapa, con capacidad de 90 megavatios, ubicada en Pueblo Nuevo Viñas, Santa Rosa.
                    </p>
                </div>
            </div>

            <div class=""col-block service-item"" data-aos=""fade-up"">
                <div class=""service-icon"">
                    <i class=""icon-cube""></i>
                </div>
                <div class=""service-text"">
                    <h3 class=""h2"">1996</h3>
                    <p ALIGN=""justify"">
                        La era de la modernización.

                     ");
                WriteLiteral(@"   El INDE comienza su era de modernización en el año 1996, después de que el Congreso de la República, aprueba el decreto 64-94, la nueva Ley Orgánica del INDE, donde se le otorga autonomía propia.
                        En 1996 entra en vigencia la Ley General de Electricidad, la cual obliga al INDE a la separación de funciones: generación, transmisión y distribución.
                        Con base en esta Ley, el INDE desincorpora de sus funciones la Empresa de Distribución de Energía Eléctrica de Oriente y de Occidente y con los fondos de
                        dicha venta se funda un fideicomiso para llevar la energía eléctrica a todo el país.
                    </p>
                </div>
            </div>

            <div class=""col-block service-item"" data-aos=""fade-up"">
                <div class=""service-icon""><i class=""icon-battery-high""></i></div>
                <div class=""service-text"">
                    <h3 class=""h2"">2018</h3>
                    <p ALIGN=""justify"">
    ");
                WriteLiteral(@"                    El INDE sigue con pasos agigantados la senda de una mejor productividad y desarrollo institucional,
                        lo que le ha valido para colocarse como la primera entidad eléctrica del país y proyectándose como
                        la institución con más función social, al tener tres programas de alto impacto para la población guatemalteca
                    </p>
                </div>
            </div>

        </div> <!-- end services-list -->

    </section> <!-- end s-services -->
